import React from "react";
import { Button } from "@mui/material";

const Projectshow = () => {
  return (
    <div>
      <br/>

      <h1>Projects</h1>
      <div className="box">
        <br />
        <h2>Projects</h2>
        <br />
        <div className="box2">
          <input
            type={"text"}
            placeholder="Enter Project Name"
            className="bold"
          />
          &nbsp;&nbsp;
          <Button variant="contained" color="warning">
            Success
          </Button>
          <br />
          <br />
          <hr />

        </div>
      </div>
    </div>
  );
};

export default Projectshow;
